    <div style={{ width: "90%", borderRadius: 25, background: "whitesmoke" }}>
      {console.log("stats", stats.stats)}
      <div className="w-full flex justify-around">
        <Balance />
        <Balance />
      </div>
    </div>
  );
};

export default StatsContainer;
